package listaL;

public class listaL2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		String letra;
		String a;
		String z;
		
		for(letra=a;letra<=z;letra++) {
			System.out.println("Numero - " + letra);
		}
		
		for(letra=z;letra>=a;letra--) {
			System.out.println("Numero - " + letra);
		}
		
	}

}
